import React from 'react'
import { useEffect } from 'react'
import * as THREE from "three";


const Header = () => {

    useEffect(()=> {
        class webgl{
            constructor(){
                this.container = this.container = document.querySelector('main');
            }
        }
    })

    return (
        <div>
            <main>
                <h1>HEADER PAGE</h1>
            </main>

        </div>
    )
}

export default Header
